// search.component.ts
import { Component } from '@angular/core';
import { SearchBook } from '../book.model';

@Component({
  selector: 'app-search',
  templateUrl: './search.component.html',
  styleUrls: ['./search.component.css']
})
export class SearchComponent {
  searchQuery: string = '';
  books: SearchBook[] = [
    { name: 'Book 1', author: 'Author 1', genre: 'Genre 1', year: 2021 },
    { name: 'Book 2', author: 'Author 2', genre: 'Genre 2', year: 2020 },
    { name: 'Book 3', author: 'Author 3', genre: 'Genre 1', year: 2019 },
    { name: 'Book 4', author: 'Author 4', genre: 'Genre 2', year: 2022 },
    // Add more books manually
  ];
  searchResults: SearchBook[] = [];

  searchBooks(): void {
    this.searchResults = this.books.filter(book =>
      book.name.toLowerCase().includes(this.searchQuery.toLowerCase()) ||
      book.author.toLowerCase().includes(this.searchQuery.toLowerCase()) ||
      book.genre.toLowerCase().includes(this.searchQuery.toLowerCase()) ||
      book.year.toString().includes(this.searchQuery.toLowerCase())
    );
  }
}
<ul class="navbar">
  <li><a class="active" [routerLink]="['/home']">Home</a></li>
  <li><a class="active" [routerLink]="['/book-list']">BookList</a></li>
  <li><a [routerLink]="['/search']">Search</a></li>
  <li><a [routerLink]="['/book-availability']">Availability</a></li>
  <li><a [routerLink]="['/cart']">Cart</a></li>
  <li><a class="login" [routerLink]="['/login']">Login</a></li>
  <li><a [routerLink]="['/register']">Signup</a></li>
</ul>
<br>

<div class="search-container">
  <h1>Search the Books</h1>
  <input type="text" class="search-input" [(ngModel)]="searchQuery" (input)="searchBooks()" placeholder="Search books...">&nbsp;
  <button class="button" (click)="searchBooks()">Search</button>
</div>

<div class="search-results">
  <table class="table">
    <tr>
      <th>Book Name</th>
      <th>Author Name</th>
      <th>Genre</th>
      <th>Year</th>
    </tr>
    <tr *ngFor="let book of searchResults">
      <td>{{ book.name }}</td>
      <td>{{ book.author }}</td>
      <td>{{ book.genre }}</td>
      <td>{{ book.year }}</td>
    </tr>
  </table>
</div>
